import React from 'react';

import Header from './Header';
import Footer from './Footer';
import Nota from './Nota';
import notas from '../notas';

function crearNotas(nota) {
    return ( 
        <Nota 
            key={nota.key}
            titulo={nota.titulo}
            contenido = {nota.contenido}
        />
    )
}

function App() {
    return(
        <div>
            <Header />
            {notas.map( crearNotas() )}
            {/* <Nota /> */}
            <Footer />
        </div>
    );
}

export default App;
